  //     }
  // }

  //

  const showPlace = () => {
    console.log('City master...!')

    fetch(`${API}/showlocation`)
      .then(async res => {
        const fetchData = await res.json()
        return fetchData
      })
      .then(fetchData => {
        setShowlocation(fetchData.data.location)
        console.log('fetchData.data.location: ', fetchData.data.location)
      })
      .catch(err => {
